const addMoviesList = [
  {
    labelText: 'Títulos',
    labelId: 'title-input-label',
    inputId: 'title-input',
    inputType: 'text',
    inputName: 'title',
    inputValue: { title },
  },
  {
    labelText: 'Subtítulo',
    labelId: 'subtitle-input-label',
    inputId: 'subtitle-input',
    inputType: 'text',
    inputName: 'subtitle',
    inputValue: { subtitle },
  },
  {
    labelText: 'Imagem',
    labelId: 'image-input-label',
    inputId: 'image-input',
    inputType: 'text',
    inputName: 'imagePath',
    inputValue: { imagePath },
  },
  {
    labelText: 'Sinopse',
    labelId: 'storyline-input-label',
    inputId: 'storyline-input',
    inputType: 'textarea',
    inputName: 'storyLine',
    inputValue: { storyLine },
  },
  {
    labelText: 'Avaliação',
    labelId: 'rating-input-label',
    inputId: 'rating-input',
    inputType: 'number',
    inputName: 'rating',
    inputValue: { rating },
  },
];

export default addMoviesList;
